import React, { useEffect } from "react";
import { Link } from "react-router-dom";

interface MenuProps {
  userToken: number;
}

export default function Menu(props: MenuProps) {
  useEffect(() => {
    if (props.userToken === null) {
      HistoryRouterProps.push();
    }
  }, []);

  return (
    <div className="Menu">
      <div className="menu">
        <Link to="/play">
          <button>
            <p>START</p>
          </button>
        </Link>
        <Link to="/options" className="button">
          <button>
            <p>OPTIONS</p>
          </button>
        </Link>
        <Link to="/about" className="button">
          <button>
            <p>ABOUT</p>
          </button>
        </Link>
      </div>
    </div>
  );
}
